import { Component, OnInit } from '@angular/core';
import { AuthService } from '@auth0/auth0-angular';

@Component({
  selector: 'app-navbar-sidebars',
  templateUrl: './navbar-sidebars.component.html',
  styleUrls: ['./navbar-sidebars.component.scss']
})
export class NavbarSidebarsComponent implements OnInit {

  constructor(public authService: AuthService) {}

  ngOnInit(){
  }

  logout() {
    this.authService.logout();
    sessionStorage.removeItem('loggedIn');
  }

}
<nav class="navbar navbar-dark bg-dark fixed-top">
    <div class="container-fluid">
      <a class="navbar-brand" href="#">Piedra Papel o Tijera!</a>
      <button class="navbar-toggler" type="button" data-bs-toggle="offcanvas" data-bs-target="#offcanvasDarkNavbar" aria-controls="offcanvasDarkNavbar">
        <span class="navbar-toggler-icon"></span>
      </button>
      <div class="offcanvas offcanvas-end text-bg-dark" tabindex="-1" id="offcanvasDarkNavbar" aria-labelledby="offcanvasDarkNavbarLabel">
        <div class="offcanvas-header">
          <h5 class="offcanvas-title" id="offcanvasDarkNavbarLabel">Menu</h5>
          <button type="button" class="btn-close btn-close-white" data-bs-dismiss="offcanvas" aria-label="Close"></button>
        </div>
        <div class="offcanvas-body">
          <ul class="navbar-nav justify-content-end flex-grow-1 pe-3">
            <li class="nav-item">
              <a class="nav-link" aria-current="page" href="/instruciones" >instrucción del juego</a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">Rankin</a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#" (click)="logout()">Salir</a>
            </li>
          </ul>
        </div>
      </div>
    </div>
  </nav>
